/* SYNTAX VARIABLES */
/* COLOR PALETTE */
/*
  OPEN COLOR 1.6.2
  by yeun
  github.com/yeun/open-color
*/
.github-DotComMarkdownHtml > *:last-child {
  margin-bottom: 0;
}
.github-DotComMarkdownHtml h1,
.github-DotComMarkdownHtml h2,
.github-DotComMarkdownHtml h3,
.github-DotComMarkdownHtml h4,
.github-DotComMarkdownHtml h5,
.github-DotComMarkdownHtml h6 {
  line-height: 1.2;
  margin-top: 1.5em;
  margin-bottom: 0.5em;
  color: #ffffff;
}
.github-DotComMarkdownHtml h1 {
  font-size: 1.5em;
  font-weight: 400;
}
.github-DotComMarkdownHtml h2 {
  font-size: 1.3em;
  font-weight: 400;
}
.github-DotComMarkdownHtml h3 {
  font-size: 1.2em;
  font-weight: 500;
}
.github-DotComMarkdownHtml h4 {
  font-size: 1.1em;
  font-weight: 600;
}
.github-DotComMarkdownHtml h5 {
  font-size: 1em;
  font-weight: 600;
}
.github-DotComMarkdownHtml h6 {
  font-size: .9em;
  font-weight: 600;
}
.github-DotComMarkdownHtml h2 {
  padding-bottom: .25em;
  margin-bottom: 0.75em;
  border-bottom: 1px solid #363659;
}
.github-DotComMarkdownHtml strong {
  color: #ffffff;
}
.github-DotComMarkdownHtml del {
  color: #626274;
}
.github-DotComMarkdownHtml a,
.github-DotComMarkdownHtml a code {
  color: #33a0ff;
}
.github-DotComMarkdownHtml img {
  max-width: 100%;
}
.github-DotComMarkdownHtml > p {
  margin-top: 0;
  margin-bottom: 1.5em;
}
.github-DotComMarkdownHtml > ul,
.github-DotComMarkdownHtml > ol {
  margin-bottom: 1.5em;
  padding-left: 2em;
}
.github-DotComMarkdownHtml li {
  padding-top: .1em;
  padding-bottom: .1em;
}
.github-DotComMarkdownHtml li li {
  font-size: 1em;
}
.github-DotComMarkdownHtml .task-list-item {
  list-style: none;
}
.github-DotComMarkdownHtml .task-list-item .task-list-item-checkbox {
  position: absolute;
  margin-left: -20px;
}
.github-DotComMarkdownHtml blockquote {
  margin: 1.5em 0;
  padding: .25em 1em;
  font-size: inherit;
  color: #626274;
  border-color: #363659;
  border-width: 3px;
}
.github-DotComMarkdownHtml hr {
  margin: 2.25em 25%;
  border-top: 1px solid #363659;
  background: none;
}
.github-DotComMarkdownHtml table {
  margin: 1.5em 0;
}
.github-DotComMarkdownHtml th {
  color: #ffffff;
}
.github-DotComMarkdownHtml th,
.github-DotComMarkdownHtml td {
  padding: .66em 1em;
  border: 1px solid #363659;
}
.github-DotComMarkdownHtml pre,
.github-DotComMarkdownHtml code {
  color: #ffffff;
  background-color: #363659;
}
.github-DotComMarkdownHtml pre {
  margin: 1.5em 0;
}
.github-DotComMarkdownHtml pre > code {
  white-space: pre;
}
.github-DotComMarkdownHtml .highlight {
  margin: 1.5em 0;
}
.github-DotComMarkdownHtml .highlight pre {
  margin: 0;
}
.github-DotComMarkdownHtml kbd {
  color: #ffffff;
  border: 1px solid #363659;
  border-bottom: 2px solid #2b2b46;
  background-color: #363659;
}
